import React from "react";
import CoverImg from "../../Assests/Images/background/bg-1.png";
import UserImg from "../../Assests/Images/user/sha.jpeg";

function Profile() {
  return (
    <div className="card">
      <img src={CoverImg} className="card-img-top" alt="Background Cover" />
      <div class="position-relative">
        <div class="position-absolute top-50 start-50 translate-middle">
          <img src={UserImg} className="card-img-top rounded-circle w-75" alt="Background Cover" />
        </div>
      </div>
      <div class="card-body">
        <p class="card-text">
          Some quick example text to build on the card title and make up the
          bulk of the card's content.
        </p>
      </div>
    </div>
  );
}

export default Profile;
